Moses

History Documentary hosted by Tom Hodgkins, published by BBC in 2002 - English narration


Information
------------------------------

Law-giver, liberator and spiritual leader - Moses is one of a small number of figures who have transformed the course of human history.
In Moses, the latest scientific evidence is combined with state-of-the-art computer graphics and dramatic reconstructions to reveal the sensational truths that lie at the heart of the Moses story.
Moses is a hugely influential prophet in Christianity, Judaism and Islam. And, in the Ten Commandments, he outlined a basis for morality which has lasted over 3,000 years and been embraced by two-thirds of the world's population.
However, some scholars claim that there is no firm evidence to prove that Moses ever existed and that the extraordinary stories of his life are mere fantasy. The Bible is frustratingly vague about crucial details of the story, such as where the Hebrews lived or when the story is set.
Moses goes on a quest for evidence, looking beyond the narrow confines of Biblical studies to bring in research from other fields, such as archaeology, anthropology, climatology, oceanography and vulcanology. What emerges are some startling insights into natural phenomena that could have inspired tales such as the Parting of the Red Sea and and the Ten Plagues.
The team behind the award-winning Son Of God brings this fantastical tale to life using the same mix of computer imagery and live action. 

BBC/TLC co-production in association with Jerusalem Productions

